import React, { useEffect } from 'react'
import { Routes,Route } from 'react-router-dom'
import Home from '../Home'
import {getLatestMeal, getPopular,getRandomMeal, getRondomingredints, getCountryMeals } from "../../Redux-toolkit/MealSlice/MealSice"
import { useDispatch } from 'react-redux'
import InfoIngredients from "../../Components/info-ingredients"
import PopularInfoIngredints from "../../Components/Popular-infoingredients"
import CountryInfo from '../../Components/Country-info'
import AlfavitInfo from '../../Components/Alfavit-info'


const Main=()=> {
    const dispatch=useDispatch();
    useEffect(()=>{
        dispatch(getLatestMeal());
        dispatch(getPopular());
        dispatch(getRandomMeal());
        dispatch(getRondomingredints());
        dispatch(getCountryMeals());
    },[])
    return (
        <div>
         <Routes>
            <Route path='/' element={<Home/>}/>
            <Route path='/meal/:idMeal/:title' element={<InfoIngredients/>}/>
            <Route path='/ingredient/:title' element={<PopularInfoIngredints/>}/>
            <Route path='/meals/:country' element={<CountryInfo/>}/>
            <Route path='/alfavit/:meals' element={<AlfavitInfo/>}/>
            <Route path='/alfavit/:meals' element={<AlfavitInfo/>}/>
         </Routes>
        </div>
    )
}
export default Main
